After a solid day of filming @zepolage and @jameswebby met back up at the shop and whipped the cams out again to film a little session in the back! All of our team/employees are always riding the back of the shop and sometimes the sessions get pretty wild so we figured we'd start documenting some of them! Let us know if you want to see more from our team in the back!

